column4:
Jeśli aplikacja jest nieużywana od kilku miesięcy:

• aby chronić Twoje dane, odbieramy jej uprawnienia;
• zatrzymujemy powiadomienia, aby oszczędzać baterię;
• usuwamy pliki tymczasowe, aby zwolnić miejsce.

Aby ponownie przyznać uprawnienia i zezwolić na powiadomienia, otwórz aplikację.
